export const submitEmail = async (email) => {
  const prevEmail = localStorage.getItem("email");
  if (prevEmail == email) {
    return {
      status: 200,
      success: true,
      message: "Email already exist!"
    };
  } else {
    return {
      status: 404,
      success: false,
      message: "Email doesn't exist!"
    };
  }
};
